import { useMemo } from "react";
import { Text, TouchableOpacity } from "react-native";

const TodayWorkout = () => {
    const todayDate = useMemo(() => new Date().toLocaleString().split(",")[0], []);

    return (<>
        <Text>{todayDate}</Text>
        <TouchableOpacity>Press</TouchableOpacity>
    </>);
}

export default TodayWorkout;
